주어진 SQL 문이 주어진 질문에 적절하게 대응하는지 결정하십시오. SQL 쿼리는 특정 조건이 적용되는 테이블에서 데이터를 선택하여 작동합니다. 테이블에는 각 열의 모든 행에 대한 값이 있어야합니다. 모든 테이블에는 일반적으로 ID와 같은 각 행을 고유하게 식별하는 기본 키가 있습니다. 반환 할 열을 선택하려면 "SELECT" 문 이후에 지정합니다. 그런 다음 "FROM" 문을 사용하여 데이터를 선택할 원하는 테이블을 지정합니다. 해당하는 이름으로 그것을 다시 명명할 수있는 "AS" 문으로 해당 이름으로 참조 할 수 있습니다. 여러 개의 테이블에서 데이터를 선택하려면 "JOIN" 문을 사용해야합니다. 이것은 한 개의 행과 다른 개의 모든 열 (카르테시안 곱) 을 결합하여 두 개의 개체를 결합합니다 . 반환되는 줄 수를 제한하기 위해 "ON" 문을 사용해야합니다 . 이것은 일반적으로 기본키와 동일한 조건 (등호 연산자) 이 참 인 경우만 줄 만 반환합니다 .특정 조건 충족 시 열 값 만 반환되도록하려면 "WHERE" 문을 사용할 수 있습니다. "GROUP BY" 문은 문이 따라오는 열에 대해 동일한 열 값을 가진 행을 그룹화합니다. "HAVING" 문은 문이 따라오는 조건을 충족하는 그룹을 반환합니다. 그룹화 된 행에서 반환되는 모든 열은 집계 함수 (AVG, MAX, COUNT, SUM 등) 중 하나의 열 또는 데이터가 그룹화 된 열 (s) 이어야합니다 . 반환된 데이터를 정렬하려면 "ORDER BY" 명령문을 사용하여 명령문 이후에 따르는 집계 함수 또는 열로 데이터를 정렬 할 수 있습니다 . "DESC" 명령문은 내림차순으로 정렬하고 "ASC" 명령문은 오름차순으로 정렬합니다. 마지막으로, SQL 문에서 "*"를 사용하면 모든 열이 반환됩니다. 예 : SELECT * FROM table WHERE attribute = 1 은 속성 열이 1 인 행에서 모든 열을 선택합니다.

