?x0 ns:film.film.executive_produced_by M0 .
?x0 ns:film.film.written_by ?x1 .
?x1 a ns:fictional_universe.fictional_character
} Question: M2가 작성하고 영화 프로듀서가 감독 한 M1, M3, M4, M5 및 M6 인가요?

